import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import ColorList from './components/ColorList';
import ColorDetail from './components/ColorDetail';
import ColorForm from './components/ColorForm';
import NotFound from './components/NotFound';

function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/colors" component={ColorList} />
                <Route exact path="/colors/new" component={ColorForm} />
                <Route exact path="/colors/:color" component={ColorDetail} />
                <Route exact path="/"><Redirect to="/colors" /></Route>
                <Route exact path="*"><Redirect to="/colors" /></Route>
                {/* Redirects all other invalid URLs to ColorList */}
                {/* NotFound component could be added for a custom 404 page */}
            </Switch>
        </Router>
    );
}

export default App;
